import React from 'react'
// import CoachMap from '../CoachMap/CoachMap'
import css from './coachBox.scss'
export default function CoachBox({ coachData, children, iconexclamation }) {


    return (
        <div className={css.coachBox}>
            <div className={css.coachBox__info}>
                <img className={css.coachBox__info__icon} src={iconexclamation} alt="" />
                <div className={css.coachBox__info__title}>
                    Informations
                </div>
                <div className={css.line}></div>
                {children}
            </div>
            <div className={css.coachBox__lieu}>
                <img className={css.coachBox__lieu__icon} src='../icon/localisationicon.png' alt="" />
                <div className={css.coachBox__lieu__title}>
                    Lieux
                </div>
                <div className={css.line}></div>
                <iframe className={css.coachBox__map} width="600" height="450"  src="https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d18050.29913978666!2d10.314591236709902!3d36.89340474337109!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sfr!2stn!4v1614267437827!5m2!1sfr!2stn" ></iframe>
                <div className={css.coachBox__lieu_map}>
                    {coachData.coachData.privateCourseData.location.map(location => (

                        <div className={css.coachBox__lieu_map__mapicon}>
                            <img src="../icon/localisation.png" alt="icon" />

                            <div className={css.coachBox__lieu_map__mapicon__lieu}>
                                {location.title}
                            </div>
                        </div>
                    )
                    )}
                </div>
            </div>

            <div className={css.coachBox__video}>
                <div className={css.coachBox__video__linevertical}></div>
                <img className={css.coachBox__video__icon} src="../icon/videoicon.png" alt="" />
                <div className={css.coachBox__video__title}>
                    Vid√©o
                </div>
                <div className={css.line}></div>
                <div>
                    <iframe className={css.coachBox__video__videocoach} width="420" height="315"
                        src="https://www.youtube.com/embed/tgbNymZ7vqY" >

                    </iframe>
                    <div className={css.coachBox__video__titlevideo}>ABDOS - CUISSES - FESSIERS </div>
                    <div className={css.coachBox__video__date}>19 Dec 2020</div>
                </div>
                <div className={css.coachBox__video__othervideo} >
                    <div>
                        <iframe className={css.coachBox__video__videocoachother} width="420" height="315"
                            src="https://www.youtube.com/embed/tgbNymZ7vqY">
                        </iframe>
                        <div className={css.coachBox__video__titlevideo}>OBTENIR UN VENTRE PLAT ! </div>
                        <div className={css.coachBox__video__date}>19 Dec 2020</div>
                    </div>
                    <div>
                        <iframe className={css.coachBox__video__videocoachother} width="420" height="315"
                            src="https://www.youtube.com/embed/tgbNymZ7vqY">
                        </iframe>
                        <div className={css.coachBox__video__titlevideo}>OBTENIR UN VENTRE PLAT ! </div>
                        <div className={css.coachBox__video__date}>19 Dec 2020</div>
                    </div>
                    <div>
                        <iframe className={css.coachBox__video__videocoachother} width="420" height="315"
                            src="https://www.youtube.com/embed/tgbNymZ7vqY">
                        </iframe>
                        <div className={css.coachBox__video__titlevideo}>OBTENIR UN VENTRE PLAT ! </div>
                        <div className={css.coachBox__video__date}>19 Dec 2020</div>
                    </div>
                    <div>
                        <iframe className={css.coachBox__video__videocoachother} width="420" height="315"
                            src="https://www.youtube.com/embed/tgbNymZ7vqY">
                        </iframe>
                        <div className={css.coachBox__video__titlevideo}>OBTENIR UN VENTRE PLAT ! </div>
                        <div className={css.coachBox__video__date}>19 Dec 2020</div>
                    </div>
                </div>
            </div>
            <div className={css.coachBox__photo}>
                <div className={css.coachBox__photo__linevertical}></div>
                <img className={css.coachBox__photo__icon} src="../icon/exclamation.png" alt="" />
                <div className={css.coachBox__photo__title}>
                    Photos
                </div>
                <div className={css.line}></div>
                <div className={css.coachBox__photo__photocoachprincipal}  >
                    <img src="data:image/jpeg;base64,"
                    />
                </div>
                <div className={css.coachBox__photo__photocoachother}>
                    <img src="data:image/jpeg;base64," alt="" />
                    <img src="data:image/jpeg;base64," alt="" />
                    <img src="data:image/jpeg;base64," alt="" />
                    <img src="https://www.lequipe.fr/_medias/img-photo-jpg/apres-une-semaine-d-ecran-noir-les-chaines-bein-sports-reprennent-la-diffusion-de-la-serie-a-ce-ven/1500000001350446/0:0,1995:1330-624-416-75/7df54.jpg" alt="" />

                </div>
            </div>
        </div>

    )
}
